import React, { Component } from 'react';
import '../website.css';
import CodeBase from '../images/codebase_icon.png';
import Ginger from '../images/ginger_icon1.png';
import warren from '../images/warren.JPG';



class Experiences extends Component {

    constructor(props) {
        super(props);
        this.routeToExp = this.routeToExp.bind(this);
    }
    routeToHome() {
        const path = '/';
        this.props.history.push(path);

    }

    routeToExp() {
        const path = '/experiences';
        this.props.history.push(path);

    }

    routeToAbt() {
        const path = '/about';
        this.props.history.push(path);

    }

    render() {
        var experiences = [{ date: "January 2019 - Current", img: CodeBase, desc: "I’m part of a student organization at UC Berkeley called CodeBase. Ever semester, we partner with 4 different bay-area tech companies and build cool projects for them. Check out some of the projects we’ve completed in the past!" },
        { date: "Summer 2019", img: Ginger, desc: "I’m currently a full time intern at ginger.io doing full-stack web development and having a blast! " }
        ];

        console.log("rendering exp");
        return (
            <div className="Experiences">
                <div className="EP-container">
                    <img className="EP-image" src={warren} />
                    <div className="EP-overlay">
                        <p onClick={() => this.routeToHome()} className="text">HOME</p>
                        <p onClick={() => this.routeToAbt()} className="text">ABOUT ME</p>
                        <p onClick={() => this.routeToExp()} className="text">TECHNICAL</p>




                    </div>

                    <div className="exp-descriptions">
                        {experiences.map((exp) => (
                            <div className="exp">
                                <p className="exp-date">{exp.date} </p>

                                <p className="exp-desc">{exp.desc} </p>
                            </div>
                        )
                        )}
                    </div>

                </div>
                <div className="exp-content">
                <div className="header">
                    MY PROJECTS
                </div>
                    <div className="exp-images">
                        {experiences.map((exp) => (
                            <div className="exp">
                                <img src={exp.img} className="exp-img" />
                            </div>
                        )
                        )}
                    </div>

                </div>

            </div>
        );
    }
}

export default Experiences;
